// SPDX-License-Identifier: GPL-3.0
pragma solidity 0.8.13;

import "./ERC721Token.sol";

contract SaleFactory {

    event AmountSalePriceDeposit(address buyer, uint amount, address contractCollection, uint256 tokenId);
    event TransferredToken(address owner, address buyer, address contractCollection, uint256 tokenId);
    event SaleCreated(address contractCollection, uint256 tokenId, uint256 price);

    struct Sale {
        uint256 tokenId;
        uint256 price;
    }
    mapping(address => Sale[]) private sales;

    // contract address => token => index
    mapping(address => mapping(uint256 => uint256)) private salesTokenIndex;

    function createSale(address _contractCollection, uint256 _tokenId, uint256 _price) external {
        salesTokenIndex[_contractCollection][_tokenId] = sales[_contractCollection].length;
        sales[_contractCollection].push(Sale(_tokenId, _price));

        emit SaleCreated(_contractCollection, _tokenId, _price);
    }

    function getPrice(address _contractCollection, uint256 _tokenId) public view returns(uint256){
        uint index = salesTokenIndex[_contractCollection][_tokenId];

        return sales[_contractCollection][index].price;
    }

    function getSales(address _contractCollection) public view returns(Sale[] memory) {
        return sales[_contractCollection];
    }

    function getIndexByCollectionAndToken(address _contractCollection, uint256 _tokenId) public view returns (uint256) {
        return salesTokenIndex[_contractCollection][_tokenId];
    }

    function pay(address _contractCollection, uint256 _tokenId) external payable {
        // deposit
        uint index = salesTokenIndex[_contractCollection][_tokenId];
        require(sales[_contractCollection][index].price == msg.value, "amount deposited is different from the price");
        emit AmountSalePriceDeposit(msg.sender, msg.value, _contractCollection, _tokenId);

        // transfer token bought
        address owner = ERC721Token(_contractCollection).ownerOf(_tokenId);
        ERC721Token(_contractCollection).transferFrom(owner, msg.sender, _tokenId);
        emit TransferredToken(owner, msg.sender, _contractCollection, _tokenId);

        // pay old owner
        payable(owner).transfer(msg.value);
    }

    function approveToken(address _contractCollection, uint256 _tokenId) external {
        ERC721Token(_contractCollection).approve(msg.sender, _tokenId);
    }

    function getApprovals(address _contractCollection, uint256 _tokenId) public view returns(address) {
        return ERC721Token(_contractCollection).getApproved(_tokenId);
    }

    function isApprovedOrOwner(address _contractCollection, uint256 _tokenId) public view returns(bool) {
        return ERC721Token(_contractCollection).isApprovedOrOwner(msg.sender, _tokenId);
    }
}
